let allCities;
const CitiesAndCodes = async () => {
  try {
    const response = await fetch("http://localhost:3000/", {
      method: "GET",
      headers: { "Content-Type": "application/json" },
    });
    const data = await response.json();
    allCities = data;
    console.log(allCities); // This will log the fetched data
    // You can perform other operations with allCities here
  } catch (error) {
    console.error("Error fetching cities:", error);
  }
};
export default CitiesAndCodes;
